import React, { useState } from 'react';
import styles from './Deep.module.css';

const Deep = () => {
  const [showKt, setShowKt] = useState(false);

  const handleHedisClick = () => {
    setShowKt(!showKt);
  };

  return (
    <nav className={styles['deep-nav']}>
      <ul className={styles['deep-menu']}>
        <li>
          <a onClick={handleHedisClick}>Hedis</a>
          {showKt && (
            <ul className={styles['deep-submenu']}>
              <li><a>Hedis Kt(Day 1)</a></li>
              <li><a>Hedis Kt(Day 2)</a></li>
              <li><a>Hedis Kt(Day 3)</a></li>
              <li><a>Hedis Kt(Day 4)</a></li>
              <li><a>Hedis Kt(Day 5)</a></li>
              <li><a>Hedis Kt(Day 6)</a></li>
              <li><a>Hedis Kt(Day 7)</a></li>
              <li><a>Hedis Kt(Day 8)</a></li>
              <li><a>Hedis Kt(Day 9)</a></li>
            </ul>
          )}
        </li>
        <li><a>Fee Schedule</a></li>
      </ul>
    </nav>
  );
};

export default Deep;
